import React from "react";
import "./style.css";

const Footer = () => (
<div class="container">
  <nav class="navbar navbar-expand-lg navbar-light bg-light">
    <a class="navbar-brand" href="#">Navbar</a>
  </nav>
</div>
);

export default Footer;
